import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <main className="App">
      <nav>
        Form
      </nav>
      <section className="display">
        <p>PCs</p>
        <p>NPCs</p>
        <p>BADs</p>
      </section>
    </main>
  );
}

export default App;
